webpackJsonp([0x65520345e032],{302:function(A,e){A.exports={data:{post:{title:"Edition 9 (1/31/18)",content:'<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Friends and family,</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Happy Wednesday!!! Today&rsquo;s brief is packed, so strap in and let&rsquo;s roll.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><u><span style="color:#000000">Intro points</span></u></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">For some time now, we have been stating the obvious: we are in a bull market. Anybody can see that, but nobody can predict how long it will continue. That said, it&rsquo;s always interesting to hear the major players&rsquo; outlooks on 2018. In its Global Research Highlights report last week, Bank of America Merrill Lynch (BAML) touched on several issues: one of which is its S&amp;P 500 year-end target of 3000. This represents a 4.46% upside from last Friday&rsquo;s (1/26/18) close. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Certainly not the fast track ride of 2017, but BAML&rsquo;s calling for an extension of the market&rsquo;s performance nonetheless. Will this projection be realized? History tells us that institutions&rsquo; outlooks have mixed results.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Anyways, let&rsquo;s pick up where we left off last week -- interest rates!</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><u><span style="color:#000000">Interest Rate Environment continued</span></u></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Resuming where we left off last week - having drawn the connection between years of low rates market wide and the effect of this environment on debt accumulation &ndash; let&rsquo;s have a look under the hood of the corporate debt currently, shall we? </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">While we already looked at some charts last week, let&rsquo;s add in a corporate specific picture here. This is an older chart, but you can see the trajectory (For our chart source and more reading on the parabolic rise of debt in recent quarters, see this </span><a href="https://northmantrader.com/2018/01/04/the-debt-beneath/"><span style="color:#1155cc">blog</span></a><span style="color:#000000"> which we follow closely). </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img alt="https://lh6.googleusercontent.com/-C8rewE57JdDmKtAk10_sx2RQlIkgoZWjNv4gtgR5_cPEc9OqfGDttiSUHnXT7xZUL_HWnt8j7a7UlzLOpyvX0flF4z3fCLZfLS1j3CBwTqR8PtHapeNgvajt4EKt9mtMdSfcxmS" src="data:image/png;base64," style="height:324px; width:624px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Here we see an extension of the portrait we&rsquo;ve been painting; the low rate program as endorsed by the Federal Reserve has kicked the appetite for debt into gear, as companies nationwide are investing in new projects, or leveraging debt to make strategic acquisitions. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">What happens as rates rise? In addition to all the points we mentioned last week, rising rates will have profound effects on corporate cash allocation. Per the recently released &ldquo;Us Equity Strategy in Pictures&rdquo;1</span><span style="color:#000000"> (a separate report from BAML), corporations will allocate a significant portion of excess cash in 2018 to paying down debt in the rising rate environment. This isn&rsquo;t to say they will abandon M&amp;A and other forms of capital investment (in fact M&amp;A is cited as another focal area for 2018 in the report), rather, we merely wish to acknowledge that rising rates will raise the percentage of cash companies divert to paying down debt. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Another piece of the interest rate puzzle we promised to touch on last week pertains to the market for interest rate swaps. To preface this slight tangent, let us start by saying that the notional value outstanding in interest rate swaps in 2014 was ~ 4x the size of the global equity market. Swaps are contracts that are drawn up directly by two parties (and are thus theoretically zero sum), so it wouldn&rsquo;t be fair to automatically characterize the swap market as dangerous for the global financial system strictly because of its size. We figure we should attest to the outsized role that these derivative financial instruments play around the globe no less. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Take a minute to collect your breath.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">A swap contract in general isn&rsquo;t that confusing. Loosely, it refers to an agreement between two parties to exchange something at a future specified date. There are sometimes conditions under which the swap will occur; if the conditions aren&rsquo;t met, the swap might not occur. Interest rate swaps (although there are myriads of variations and we do not have time nor do we have your attention for long enough to dissect them) generally take the form of an agreement to swap future cash flows. One party generally wants to <em>hedge </em></span><span style="color:#000000">its rate risk, and this party will agree to pay a certain fixed rate in the swap. The other party willingly takes on greater rate risk, and agrees to pay a floating rate, namely one that is tied to some benchmark that may or may not change significantly over the life of the swap.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">For instance, two banks might enter into a swap agreement under which <em>bank 1</em></span><span style="color:#000000"> pays 6% fixed interest, and </span><em><span style="color:#000000">bank 2</span></em><span style="color:#000000"> pays 4.5% fixed interest + LIBOR. </span><a href="https://www.investopedia.com/terms/l/libor.asp"><span style="color:#1155cc">LIBOR</span></a><span style="color:#000000"> refers to the London Interbank Offered Rate; it is calculated each business day for 5 different currencies and 7 different maturities, yielding 35 different rates. If the requisite LIBOR figure the banks agreed upon rises above 1.5%, <em>bank 1</em></span><span style="color:#000000"> will get the better deal here, but if the opposite is true, </span><em><span style="color:#000000">bank 2</span></em><span style="color:#000000"> will benefit. Check to see if this makes intuitive sense.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">LIBOR is somewhat comparable to the </span><a href="https://www.investopedia.com/terms/f/federalfundsrate.asp"><span style="color:#1155cc">Fed Funds rate</span></a><span style="color:#000000"> we discussed last week, insofar as it is a measure of short term lending rates between banks. This was a purely hypothetical example meant to be illustrative.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><u><span style="color:#000000">Interest Rates across the World</span></u></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">It&rsquo;s also worthwhile to discuss how interest rates differ across the world. As you may expect, each country or central bank experiences different macroeconomic issues and has different goals, and as a consequence, interest rates differ across the globe. You can analyze the rates of most of the world&rsquo;s countries </span><a href="http://www.cbrates.com/"><span style="color:#1155cc">here</span></a><span style="color:#000000">, as well as how they have recently changed. Some trends can generally be applied to multiple countries, however. We&rsquo;ve encountered the fact that the US lowered rates post-recession, and this </span><a href="http://www.telegraph.co.uk/business/2017/03/15/worlds-central-banks-have-set-interest-rates-since-financial/"><span style="color:#1155cc">Telegraph</span></a><span style="color:#000000"> chart alludes to a correspondent global shift towards lower rates:</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img src="data:image/png;base64," style="height:195px; width:392px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Note how some rates dip below zero. What does this mean? Nominal interest rates in many countries recently have breached the &ldquo;zero lower bound&rdquo; &mdash; or become negative. This in effect means that depositors must pay banks to store money in their accounts. Does this seem a little confusing?</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">It is! But the theory is grounded in comprehensible terms. In the wake of the recession, central banks experimented with negative rates to &ldquo;jolt lending, spur inflation and reinvigorate the economy after other options are exhausted&rdquo; (</span><a href="https://www.bloomberg.com/quicktake/negative-interest-rates"><span style="color:#1155cc">Bloomberg</span></a><span style="color:#000000">). Countries from Japan to Germany to Sweden have all experimented with the idea. In no way are we experts on negative rates, but broadly speaking, the jury seems to still be out on their effectiveness.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><u><span style="color:#000000">Relating Everything to the Current Market</span></u></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Finally, in the context of the potential interest rate concerns we have now outlined, we want to highlight that the chatter has already </span><a href="https://www.cnbc.com/2018/01/29/markets-tug-of-war-between-record-earnings-and-rate-hike-worries.html?__source=sharebar%7Ctwitter&amp;par=sharebar"><span style="color:#0000ff">begun</span></a><span style="color:#000000"> (and </span><a href="https://www.cnbc.com/2018/01/30/this-stock-market-drop-is-about-one-thing-fear-of-rising-interest-rates.html"><span style="color:#0000ff">here</span></a><span style="color:#000000">) regarding whether or not this week&rsquo;s sell-off &ndash; which stretched from futures hemorrhaging percentage points in the Monday evening session into 100 basis point losses across the Dow, NASDAQ, and the S&amp;P on Tuesday &ndash; is predicated primarily on rate concerns. We certainly think the answer is broader than this, but yes; interest rates and complementary rising bond yields (more on this later) are already playing a key role in more volatile market sentiment, as measured by rising VIX figures (more on this later as well!). Bull markets and the business cycle don&rsquo;t last forever. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Pay special attention to the end of the Fed&rsquo;s meeting today (1/31), as it should provide a signal as to what shape the Fed&rsquo;s rate policy will take for the rest of the year. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Once again, we&rsquo;ve bitten off more than we can chew, and we will not get to an analysis of interest rates and their effect on currency today. Instead, we offer some final &ldquo;Quick Hits&rdquo; below, to keep you abreast of other goings on in the markets that tie into the larger discussions we&rsquo;ve been having for 9 weeks.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><u><span style="color:#000000">Quick Hits</span></u></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><strong>One</strong>: There have been 389 trading days since a 5% pullback occurred in the S&amp;P 500. This is the second longest such run ever (409 days is the record). This likely has ~ 0 predictive value in terms of forecasting when the next major pullback will actually occur (though it&rsquo;s worth noting, it had been a statistically long time since a 1% pullback, which we got yesterday). Pullbacks aren&rsquo;t something to be maligned inherently; they are often important for long-term market health insofar as there is a school of thought that posits that a lack of smaller intermittent pullbacks makes ultimate pullbacks more volatile and violent. Here are a few different ways of looking at market pullbacks:</span></p>\r\n\r\n<ol>\r\n\t<li>Historically, 5% pullbacks have happened ~ 3x annually</li>\r\n\t<li>At least one 5% pullback over the trailing twelve months has preceded 92% of past bear markets (also per the BAML report cited earlier &ndash; link at bottom of email as well)</li>\r\n\t<li>Finally, per our own in-house statistical research, we&rsquo;ve found that historically, there is a 100% <em>theoretical</em> likelihood that a 5% fluctuation occurs in a 16 month span, or there&rsquo;s a ~72% chance of one occurring within a 12 month window. Of course, we realize theory and practice, as well as future performance and historical performance, diverge regularly</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><strong>Two</strong>: At the beginning of this week, US treasury yields continued their interstellar voyage, as demand for treasuries continued to decrease. On Monday, the 10-Year US Treasury yield sailed well past a previous resistance point of 2.63% to 2.7% +, a mark it had not hit in </span><a href="https://www.cnbc.com/2018/01/29/bonds-and-fixed-income-data-auctions-bonds-on-the-agenda-for-investors.html"><span style="color:#1155cc">4 years</span></a><span style="color:#000000">.</span></p>\r\n\r\n<ol>\r\n\t<li>Here&rsquo;s a long term trend chart of the 10-year US Treasury yield. Note the breach of the 30 year bond bull market trend line, happening, oh, right now:</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img alt="$UST10Y 1292018" src="data:image/png;base64," style="height:274px; width:624px" /></span><br />\r\n(Chart credit <a href="https://twitter.com/PainCapital">here</a>)</p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><strong>Three</strong>: Vol is back baby! After spending most of Week 6 discussing the function of the VIX and the market of volatility compression that was 2017, it&rsquo;s worth circling back to note that 2018 has seen marked increases in volatility, accompanying both the months&rsquo; gains and the last few days&rsquo; losses. Remember, the pairing of gains and increased volatility we saw this month (through the end of last week) is relatively unusual. Yesterday, in the second day of the general market sell-off, the VIX broke out of this higher consolidation pattern, surging to a high of 15.42, a nearly 50% increase to the tight 9.50-10.50 observed range that the VIX traded in for much of 2017. Choppier waters ahead! </span></p>\r\n\r\n<p>We also recognize we never went over full mathematical calculation of the VIX. <a href="https://www.omahacharts.com/single-post/2016/12/12/More-Than-You-Ever-Wanted-to-Know-About-The-VIX"><span style="color:#0000ff">Here&rsquo;s</span></a> a recent post for more on this from a technical blog we follow, should you be interested.</p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">And here we arrive &mdash; our conclusion. We hope you&rsquo;ve enjoyed us inundating you yet again with (hopefully not useless!! information. Strap on your seat belts as we wait to see if the sell-off continues, or will investors continue to buy the dip for the rest of the day and keep the gravy train chugging along?</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Stay tuned!</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">As always, it is our honor,</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Mark Grace</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Nick van Osdol</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">1 </span><a href="https://www.scribd.com/document/369989100/US-Equity-Strategy-in-Pictures"><span style="color:#1155cc">https://www.scribd.com/document/369989100/US-Equity-Strategy-in-Pictures</span></a></p>',
updated:"2018-02-10T20:19:55.727891Z",fields:{slug:"Edition-9",date:"(1/31/18)"}}},pathContext:{slug:"Edition-9"}}}});
